// @ts-nocheck
import { jsPDF } from "jspdf"
const font = '';
const fontbold = '';
var callAddFont = function () {
    this.addFileToVFS('Tinos.ttf', font);
    this.addFont('Tinos.ttf', 'Tinos', 'normal');
    this.addFileToVFS('Tinos.ttf', fontbold);
    this.addFont('Tinos.ttf', 'Tinos', 'bold');
};
jsPDF.API.events.push(['addFonts', callAddFont])